import { InputText, SendButton, InLine } from './style'

function Input() {
  return (
    <InLine>
      <InputText
        type="text"
        placeholder="Digite o palpite"
        onChange={(e) => handleChangePlayerNumber(e.target.value)}
      />
      <SendButton onClick={() => handlePlayerNumber()}>
        <p>ENVIAR</p>
      </SendButton>
    </InLine>
  )
}

export default Input
